import { React } from "react";
import { useHistory } from "react-router-dom";
import {
  Home,
  Favorite,
  Whatshot,
  TrendingUp,
  FiberNew,
  Update,
  ArrowRight,
} from "@material-ui/icons";
import "./styles.css";

const Drawer = () => {
  const history = useHistory();
  const handleHomeClick = () => {
    history.push("/");
  };
  const handlePopularClick = () => {
    history.push({
      pathname: "/goats",
      state: {
        filter: "goat",
      },
    });
  };
  const handleTrendingClick = () => {
    history.push("/");
  };
  const handleLatestClick = () => {
    history.push("/");
  };
  const handleUpcomingClick = () => {
    history.push("/");
  };
  const handleFavouritesClick = () => {
    history.push("/");
  };

  return (
    <>
      <div class="drawer-container">
        <div class="drawer-menu-item">
          <Home class="drawer-menu-icon" onClick={handleHomeClick} />
        </div>
        <div class="drawer-menu-item">
          <Whatshot class="drawer-menu-icon" onClick={handlePopularClick} />
        </div>
        <div class="drawer-menu-item">
          <TrendingUp class="drawer-menu-icon" onClick={handleTrendingClick} />
        </div>
        <div class="drawer-menu-item">
          <FiberNew class="drawer-menu-icon" onClick={handleLatestClick} />
        </div>
        <div class="drawer-menu-item">
          <Update class="drawer-menu-icon" onClick={handleUpcomingClick} />
        </div>
        <div class="drawer-menu-item">
          <Favorite class="drawer-menu-icon" onClick={handleFavouritesClick} />
        </div>
      </div>
      <ArrowRight class="expand-drawer" />
    </>
  );
};

export default Drawer;
